速乾４５秒　ハイグロッシーポリマー配合　アプリコットオイル配合　トルエンフリー　チョコレートスフレ<br><br>化粧品(\)ネイルケア・アート(\)ネイルメイク<br>ネイルパーラー 19チョコレートスフレ<br>速乾45秒、素早く乾いて重ね塗りも簡単なネイルカラーです。ハイグロッシーポリマー配合で、ツヤのある仕上がりに。爪のためにアプリコットオイル配合。トルエンフリーです。 <br>ご注意：●爪に異常があらわれたときは、ご使用をおやめください。<br>●高温及び直射日光のあたるところには置かないでください。(火気注意) 成分酢酸エチル、酢酸ブチル、ニトロセルロース、アルキッド-2、イソプロパノール、クエン酸アセチルトリブチル、ブタノール、安息香酸スクロース、(アクリル酸アルキル/ジメチコン)コポリマー、ステアラルコニウムヘクトライト、カンフル、キョウニン油、ジアセトンアルコール、アクリル酸アルキルコポリマー、オキシベンゾン-3、リンゴ酸、ジメチコン、パーフルオロオクチルトリエトキシシラン、水酸化Al、酸化チタン、酸化鉄、カーボンブラック <br>原産国：日本<br><br> 発売元、製造元、輸入元又は販売元：株式会社伊勢半03-3262-3123  <br>販売_製造元： 伊勢半<br>ブランド：ネイルパーラー<br>JAN：4901433024556<br>CS：999<br>区分：化粧品<br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
